    "2013-03-15T11:21:08.844945",nt"name": "orthorectified-photomosaic-for-fort-larned-national-historic-site-vegetation-mapping-project",nt"isopen":
    false,nt"url": null,nt"notes": "This data set contains digital ortho-imagery
    developed to support planning and delivery of USDA programs. The USDA field service
    centers use digital ortho imagery as a basic reference for conservation plans and
    soil survey. The imagery has a 1 meter ground sample distance (GSD) ortho imagery
    rectified to National Mapping Standards at the 1:24,000 scale. Imagery is based
    on a (7.5 x 15) or (7.5 x11.25) minute quarter quadrangle with a 300 meter buffer
    on all four sides. Quarter quads imagery is formatted to the UTM coordinate system
    using NAD83. Each quad may contain as much as 10% cloud cover per tile. This file
    was generated by compressing quarter quadrangle tiles that cover a project area.
    MrSID compression, with mosaic option, was used. Target values for the compression
    ratio are (15:1) and compression levels (9) are used.",nt"license_title": null,nt"extras":
